write a Python program to print out the first 100 prime numbers
Here's a Python program that prints the first 100 prime numbers using the Sieve of Eratosthenes algorithm:
```python
def generate_primes(n):
    primes = []
    for i in range(2, n+1):
        if primes[i-1] == True:
            continue

        is_prime = True
        for j in range(2, i):
            if (i % j) == 0:
                is_prime = False
                break

        if is_prime:
            primes.append(i)

    return primes[:100]
```
You can call the `generate_primes()` function with an integer argument to get a list of the first 100 prime numbers. For example, to print out the first 100 prime numbers:
```python
first_100_primes = generate_primes(25)
for prime in first_100_primes:
    print(prime)
```
